const nextBatsman = function (battingReport, batsmenOrder) {
  return batsmenOrder[battingReport.wickets + 1];
};

const swapBatsman = function (battingReport) {
  const strikeChanged = battingReport.striker;
  battingReport.striker = battingReport.nonStriker;
  battingReport.nonStriker = strikeChanged;
  return battingReport;
};

const updateStriker = function (statsOfBall, battingReport, playerList) {
  if (statsOfBall.status === 'wicket') {
    battingReport.striker = nextBatsman(battingReport, playerList);
    return battingReport;
  }

  if (statsOfBall.runs % 2 === 1) {
    battingReport = swapBatsman(battingReport);
  }

  return battingReport;
};

const updatePlayerScores = function (statsOfBall, battingReport) {
  const striker = battingReport.striker;
  let playerProfile = battingReport.players[striker];

  if (!playerProfile) {
    battingReport.players[striker] = { runs: 0, ballsFaced: 0 }; //, SR:0};
    playerProfile = battingReport.players[striker];
  }

  playerProfile.runs += statsOfBall.runs;
  playerProfile.ballsFaced++;
  // playerProfile.SR = Math.floor(playerProfile.runs / playerProfile.balls * 100);
  return battingReport;
};

const changeStats = function (statsOfBall, battingReport) {
  battingReport.currentScore += statsOfBall.runs;
  battingReport.balls += statsOfBall.balls;
  battingReport.runsPerBall.push(statsOfBall.status);

  battingReport.wickets += statsOfBall.status === 'wicket' ? 1 : 0;
  return battingReport;
};

const initializeGame = function (battingReport, playerList, team) {
  battingReport.team = team;
  battingReport.striker = playerList[0];
  battingReport.nonStriker = playerList[1];
  return battingReport;
};

const isStillBatting = function (battingReport) {
  let result = battingReport.wickets < 2 && battingReport.balls < 6;
  if (battingReport.side === 'chasing') {
    result = result && battingReport.currentScore < battingReport.target;
  }
  return result;
};

const battingStats = function (battingReport, playerList, team) {
  battingReport = initializeGame(battingReport, playerList, team);

  while (isStillBatting(battingReport)) {
    statsOfBall = randomGenerator();

    battingReport = changeStats(statsOfBall, battingReport);
    battingReport = updatePlayerScores(statsOfBall, battingReport);
    battingReport = updateStriker(statsOfBall, battingReport, playerList);
  }

  return battingReport;
};

const decideWinner = function (team1, team2) {
  if (team1.currentScore === team2.currentScore) {
    return 'Draw';
  }
  let winningTeam = team1.team;
  if (team2.currentScore > team1.currentScore) {
    winningTeam = team2.team;
  }
  return winningTeam;
};

const matchReport = function (openingTeam, chasingTeam) {
  console.table(openingTeam.players);
  console.table(chasingTeam.players);

  return {
    'OpeningTeam': openingTeam,
    'ChasingTeam': chasingTeam,
    'Winner': decideWinner(openingTeam, chasingTeam)
  };
};

const playGame = function (team1, team2) {
  const openingTeamReport = generateBattingReport();
  openingTeamReport.side = 'opening';
  const openingTeam = battingStats(openingTeamReport, team1.players, team1.name);

  const chasingTeamReport = generateBattingReport();
  chasingTeamReport.target = openingTeamReport.currentScore + 1;
  chasingTeamReport.side = 'chasing';
  const chasingTeam = battingStats(chasingTeamReport, team2.players, team2.name);

  return matchReport(openingTeam, chasingTeam);
};

