const formatAttr = function (attribute) {
  return ' ' + attribute.attr + '=' + '"' + attribute.value + '"';
};

const createAttributes = function (attributes) {
  return attributes ? attributes.map(formatAttr).join('') : '';
};

const openTag = (tag, attributes) => {
  const attributeDetails = createAttributes(attributes);
  return '<' + tag + attributeDetails + '>';
};

const closeTag = (tag) => '</' + tag + '>';

const generateTag = (tagName, content, attributes) => {
  return openTag(tagName, attributes) + content + closeTag(tagName);
};

const generateSelfCloseTag = (tagName, attributes) => {
  return openTag(tagName, attributes);
};

const capitalize = (word) => word[0].toUpperCase() + word.slice(1);

const generateTableRow = function (object, keyword) {
  const th = generateTag('th', capitalize(keyword));
  const td = generateTag('td', object[keyword]);
  const tr = generateTag('tr', th + td);
  return tr;

};

const generateStatsTable = function (object) {
  const weight = generateTableRow(object, 'weight');
  const hp = generateTableRow(object, 'hp');
  const baseXP = generateTableRow(object, 'baseXP');
  const attack = generateTableRow(object, 'attack');
  const defense = generateTableRow(object, 'defense');
  const speed = generateTableRow(object, 'speed');

  const tableBody = generateTag('tbody',
    weight + hp + baseXP + attack + defense + speed);
  const table = generateTag('table', tableBody);

  return table;
};

const typeDiv = function (type) {
  return generateTag('div', capitalize(type), [{ attr: 'class', value: type }]);
};

const generateTypeDivs = function (typesArray) {
  return typesArray.map(typeDiv).join('');
};

const headerSection = function (object) {
  const heading = generateTag('h2', capitalize(object.name));
  const divsOfTypes = generateTypeDivs(object.types);
  const mainDiv = generateTag('div', divsOfTypes,
    [{ attr: 'class', value: 'type' }]);
  const header = generateTag('header', heading + mainDiv);

  return header;
};

const generateBody = function (object) {
  const header = headerSection(object);
  const table = generateStatsTable(object);
  return header + table;
};

const generateHead = function (object) {
  const title = generateTag('title', 'Pokemon');
  const link = generateSelfCloseTag('link',
    [{ attr: 'rel', value: 'stylesheet' },
    { attr: 'href', value: 'styles.css' }]);
  // const head = generateTag('head', title + link);
  return title + link;
};

const mainBody = function (object) {
  const head = generateTag('head', generateHead(object));
  const body = generateTag('body', generateBody(object));
  const html = generateTag('html', head + body);
  return html;
};

