const getDigits = function (number) {
  return number.split('').map(digit => +digit);
};

const checkIfNumberExists = function (number, digit) {
  return number.includes(digit);
};

const checkForExactMatches = function (roundInfo) {
  return roundInfo.guessedCode.filter(
    checkIfNumberExists.bind(null, roundInfo.actualCode));
};

