const parsePokemon = function (pokeStr) {
  const fields = pokeStr.split('|');
  const [id, name, types, speed, hp, baseXP, attack, defense, weight] = fields;
  return {
    id: +id,
    name,
    types: types.split(','),
    speed: +speed,
    hp: +hp,
    baseXP: +baseXP,
    attack: +attack,
    defense: +defense,
    weight: +weight,
  };
};

const parsePokemons = function (pokemonData) {
  pokemonData.slice(1).map(parsePokemon);
};

const main = function (pokemonCsv, pokemonJSON) {
  const pokemonObject = parsePokemons(read(pokemonCsv).split('\n'));
  write(pokemonJSON, JSON.stringify(pokemonObject));
  return pokemonObject;
};

