const randomGenerator = function () {
  const events = [
    { status: 0, runs: 0, typeOfDelivery: 'legal', balls: 1, probability: 23 },
    { status: 1, runs: 1, typeOfDelivery: 'legal', balls: 1, probability: 25 },
    { status: 2, runs: 2, typeOfDelivery: 'legal', balls: 1, probability: 23 },
    { status: 3, runs: 3, typeOfDelivery: 'legal', balls: 1, probability: 4 },
    { status: 4, runs: 4, typeOfDelivery: 'legal', balls: 1, probability: 10 },
    { status: 6, runs: 6, typeOfDelivery: 'legal', balls: 1, probability: 6 },
    { status: 'wicket', runs: 0, typeOfDelivery: 'legal', balls: 1, probability: 3 },
    { status: 'wide', runs: 1, typeOfDelivery: 'illegal', balls: 0, probability: 3 },
    { status: 'noBall', runs: 1, typeOfDelivery: 'illegal', balls: 0, probability: 3 },
  ];

  const randomNumber = Math.random() * 100;
  let total = 0;
  let index = 0;
  while (total < randomNumber) {
    total += events[index].probability;
    index++;
  }
  return events[index - 1];
};

exports.randomGenerator = randomGenerator;

