const verifyExpectations = function ({ testFn, desc }) {
  const testResult = {};
  testResult.failed = false;
  testResult.desc = desc;
  try {
    testFn();
  } catch (error) {
    testResult.failed = true;
    testResult.error = error;
  }
  return testResult;
};

// const tests = [];

