// }).bind(tests);

// const tests = [];
const makeTest = function (testFn, desc) {
  return { testFn, desc };
};

const runTests = function (tests) {
  return (tests.map(verifyExpectations));
};

const logResults = function (testResult) {
  const status = testResult.failed ? '❌' : '✅';
  console.log(status, '-', testResult.desc);
  return testResult;
};

const countOfTests = function (totalTests, failedTestsCount) {
  console.log(
    'total:', totalTests,
    'passed:', totalTests - failedTestsCount,
    'failed:', failedTestsCount
  );
  return;
};

const generateReport = function (tests) {
  const report = runTests(tests);
  report.forEach(logResults);
  const failedTests = report.filter(x => x.failed);
  console.log(failedTests);
  // console.log(countOfTests(report.length, failedTests.length));
  countOfTests(report.length, failedTests.length);
  return report;
};

exports.makeTest = makeTest;
exports.generateReport = generateReport;

